    const touch = () => {
        console.warn("toucher")
    }
    return(
        <View>
            <TouchableHighlight onPress={() => { touch() }}>
                <View>
                    <FontAwesome5
                        name="question"
                        size={35}
                        color="black"
                    />
                </View>
            </TouchableHighlight>
        </View>
    )
}
